6a46e5843c71146ca364cafd5a44419dd1bbc6ee:
query ActiveBidsQuery($endTimestamp: BigInt!) {
  bidPlaceds(where: {endTimestamp_gt: $endTimestamp}) {
    id
    profileId
    pubId
    referrerProfileIds
    amount
    bidderOwner
    bidderProfileId
    endTimestamp
    timestamp
  }
}

47a48ba8eeea0c0b613b2392f76a00579f2e84f0:
query BidsQuery($profileId: BigInt!, $pubId: BigInt!) {
  bidPlaceds(where: {profileId: $profileId, pubId: $pubId}) {
    id
    profileId
    pubId
    referrerProfileIds
    amount
    bidderOwner
    bidderProfileId
    endTimestamp
    timestamp
  }
}

7a4fc4a24adef0efeb228157a83afd04ec93711f:
query ExploreBidsFromAuctions($profileIds: [BigInt!]!, $pubIds: [BigInt!]!, $bidderProfileId: [BigInt!]!) {
  bidPlaceds(
    where: {profileId_in: $profileIds, pubId_in: $pubIds, bidderProfileId_in: $bidderProfileId}
    orderBy: timestamp
    orderDirection: desc
  ) {
    id
    profileId
    pubId
    referrerProfileIds
    amount
    bidderOwner
    bidderProfileId
    endTimestamp
    timestamp
  }
}

37a36c60aaf81302d058b7800ea4091d7917fcc9:
query ExploreSoldAuctions {
  collecteds {
    id
    collectedPubId
    collectedProfileId
    nftRecipient
    collectNFT
    tokenId
    timestamp
    transactionHash
    collectorProfileId
  }
}

afb35d199b489e5ee0ba7304ed1886edf890d004:
query GetCollectedAuctionsByProfile($profileId: BigInt!) {
  collecteds(where: {collectorProfileId: $profileId}) {
    id
    collectedPubId
    collectedProfileId
    nftRecipient
    collectNFT
    tokenId
    timestamp
    transactionHash
    collectorProfileId
  }
}
